import Navigation from "../../components/navigation/Navigation";
import "./artistsPage.scss";
import Card from "../../components/card/Card";
import { useSelector } from "react-redux";

const ArtistsPage = () => {
  const artists = useSelector((state) => state.movies.moviesData.artists.items);
  return (
    <div className="artists-page page">
      <div className="p-header">
        <Navigation left={"/"} right={""} />
        <h2 className="p-title">Albums</h2>
      </div>
      <ul className="artists-ctn card-ctn">
        {artists?.map((artist, index) => (
          <Card key={index} artist={artist} />
        ))}
      </ul>
    </div>
  );
};

export default ArtistsPage;
